import React from "react";

function Details({ name, location }) {
  return (
    <div className="relative">
      {/* Background image */}
      <img src="./images/png/header.png" alt="University" className="w-full" />

      {/* Text overlay */}
      <div className="absolute top-0 left-0 right-0 bottom-0 flex flex-col justify-center items-center text-white">
        {/* University name */}
        <h2 className="text-4xl font-bold">hello</h2>

        {/* University location */}
        <p className="text-lg">hello</p>
      </div>
    </div>
  );
}

export default Details;
